Count Zaroff, a renowned big-game hunter tires of stalking animals and begins
hunting down the &quot;most dangerous game&quot; - human beings.
Luring unwary victims to his remote island, Zaroff wines and dines them, gives
them a few hours head start to run into the jungle, then hunts them down with
rifle and bow.

